<ul>
<li>指针:一个变量在内存中包含的是一个地址(指向其他数据)</li>
<li>Rust中在常见的指针就是<strong>引用</strong></li>
<li>引用:
<ul>
<li>使用符号<code>&amp;</code>表示</li>
<li>表示借用它指向的值</li>
<li>没有其余开销</li>
<li>最常见的指针类型</li>
</ul>
</li>
</ul>
